import React, { Component } from 'react';

const Profile = (props) => {
    if(!props.user.email){ 
        props.history.push('/log-in') 
    }   
    return (
        <div>
            Profile
            Welcome {props.user.email} !!! 
        </div>
    );
}

export default Profile;
